import { createElement as $ } from 'react';

const Register = () => {
	return $(
		'div',
		{ className: 'container p-5' },
		$(
			'div',
			{ className: 'row' },
			$(
				'div',
				{ className: 'col-md-6 offset-md-3' },
				$('h4', null, 'Register'),
				$('h6', null, 'Register Form')
			)
		)
	);
};

export default Register;
